import React, { useState } from "react";
import axios from "axios";

const ComparableTable = () => {
  const [file, setFile] = useState(null);
  const [comparables, setComparables] = useState([]);
  const [error, setError] = useState(null);

  const handleFileChange = (e) => {
    setFile(e.target.files[0]);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    if (!file) {
      setError("Please select a file to upload.");
      return;
    }

    const formData = new FormData();
    formData.append("file", file);

    try {
      const res = await axios.post("http://localhost:8080/api/calculate", formData, {
        headers: {
          "Content-Type": "multipart/form-data",
        },
      });

      if (res.data.comparables) {
        // Sort comparables to ensure the subject property (PropertySequenceIdentifier="0") is first
        const sortedComparables = res.data.comparables.sort((a, b) => {
          if (a.PropertySequenceIdentifier === "0") return -1;
          if (b.PropertySequenceIdentifier === "0") return 1;
          return 0;
        });

        setComparables(sortedComparables);
        setError(null);
      } else {
        setError(res.data.error || "An error occurred.");
        setComparables([]);
      }
    } catch (err) {
      setError(err.response?.data?.error || "An error occurred while uploading the file.");
      setComparables([]);
    }
  };

  return (
    <div>
      <h1>Upload XML File</h1>
      <form onSubmit={handleSubmit}>
        <input type="file" onChange={handleFileChange} accept=".xml" />
        <button type="submit">Upload</button>
      </form>
      {error && <p style={{ color: "red" }}>{error}</p>}

      {comparables.length > 0 && (
        <div>
          <h2>Comparable Properties</h2>
          <table border="1">
            <thead>
              <tr>
                <th>Address</th>
                <th>Pre-Adjustment Amount</th>
                <th>Post-Adjustment Amount</th>
                <th>Comparable Type</th>
                <th>Total Adjustment Percent</th>
              </tr>
            </thead>
            <tbody>
              {comparables.map((comp, index) => (
                <tr key={index}>
                  <td>{comp.address}</td>
                  <td>{comp.pre_adj}</td>
                  <td>{comp.post_adj}</td>
                  <td>{comp.comp_type}</td>
                  <td>{comp.total_adj_percent}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      )}
    </div>
  );
};

export default ComparableTable;
